import { useState } from 'react'
import Content from './Content'
import Button from '@mui/material/Button'

function App() {
  const [show, setShow] = useState[false]

  return (
    <div style={{ padding: 35 }} className="App">
      <h1>Hello World</h1>
      <button
        onClick={() => {
          return !show
        }}
      >
        Toggle
      </button>
      {show && <Content />}
    </div>
  )
}
export default App
